insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (653539042926592,'CiEntityCount','配置项分类统计',NULL,'<datasource name=\"CiEntityCount\" label=\"配置项分类统计\">\n  <fields>\n    <id column=\"ciEntityCount\" label=\"数量\" type=\"number\"/>\n    <field column=\"ciName\" label=\"类型\" type=\"text\"/>\n  </fields>\n  <select>\nSELECT\n	count( a.id ) as ciEntityCount,\n	b.label as ciName\nFROM\n	cmdb_cientity a\n	JOIN cmdb_ci b ON a.ci_id = b.id \nGROUP BY\n	b.label  </select>\n</datasource>',1,'0 0 3 * * ? *','replace',1,NULL,'done',18,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (653541576286208,'CiCount','模型分类统计',NULL,'<datasource name=\"CiCount\" label=\"配置模型分类统计\">\n  <fields>\n    <id column=\"ciCount\" label=\"数量\" type=\"number\"/>\n    <field column=\"typeName\" label=\"类型\" type=\"text\"/>\n  </fields>\n  <select>\nSELECT\n	count( a.id ) as ciCount,\n	b.name as typeName \nFROM\n	cmdb_ci a\n	JOIN cmdb_citype b ON a.type_id = b.id \nGROUP BY\n	b.`name`  \n  </select>\n</datasource>',1,'0 0 3 ? * SUN *','replace',NULL,NULL,'done',13,NULL,'mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (653561968992257,'CiEntityTypeCount','配置项数量',NULL,'<datasource name=\"OSCount\" label=\"操作系统数量\">\n  <fields>\n    <field column=\"ciEntityCount\" label=\"数量\" type=\"number\"/>\n  <id column=\"name\" label=\"名称\" type=\"text\"/>\n  </fields>\n  <select>\nSELECT\n	count( 1 ) as ciEntityCount,\n	\'数据库\' AS NAME \nFROM\n	cmdb_cientity \nWHERE\n	ci_id IN (\n	SELECT\n		id \n	FROM\n		cmdb_ci \n	WHERE\n		lft &gt;= ( SELECT lft FROM cmdb_ci WHERE id = 573130988855296 ) \n	AND rht &lt;= ( SELECT rht FROM cmdb_ci WHERE id = 573130988855296 )) UNION\nSELECT\n	count( 1 ) AS ciEntityCount,\n	\'操作系统\' AS NAME \nFROM\n	cmdb_cientity \nWHERE\n	ci_id IN (\n	SELECT\n		id \n	FROM\n		cmdb_ci \n	WHERE\n		lft &gt;= ( SELECT lft FROM cmdb_ci WHERE id = 479593471418368 ) \n	AND rht &lt;= ( SELECT rht FROM cmdb_ci WHERE id = 479593471418368 )) UNION\nSELECT\n	count( 1 ) AS ciEntityCount,\n	\'网络设备\' AS NAME \nFROM\n	cmdb_cientity \nWHERE\n	ci_id IN (\n	SELECT\n		id \n	FROM\n		cmdb_ci \n	WHERE\n		lft &gt;= ( SELECT lft FROM cmdb_ci WHERE id = 441115220123648 ) \n	AND rht &lt;= ( SELECT rht FROM cmdb_ci WHERE id = 441115220123648 )) UNION\nSELECT\n	count( 1 ) AS ciEntityCount,\n	\'服务器\' AS NAME \nFROM\n	cmdb_cientity \nWHERE\n	ci_id IN (\n	SELECT\n		id \n	FROM\n		cmdb_ci \n	WHERE\n	lft &gt;= ( SELECT lft FROM cmdb_ci WHERE id = 480157781467136 ) \n	AND rht &lt;= ( SELECT rht FROM cmdb_ci WHERE id = 480157781467136 ))\n  </select>\n</datasource>',1,NULL,'replace',NULL,NULL,'done',4,NULL,'mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (676690166554624,'processTaskStepUserStatus','工单步骤状态用户统计',NULL,'<datasource name=\"processTaskStepUserStatus\" label=\"工单步骤状态用户统计\">\n  <fields>\n    <id column=\"stepStatus\" label=\"步骤状态\" type=\"text\"/>\n    <id column=\"stepStatusName\" label=\"步骤状态名\" type=\"text\"/>\n		<id column=\"stepUserUuid\" label=\"处理人\" type=\"text\"/>\n		<field column=\"stepUserName\" label=\"处理人名\" type=\"text\"/>\n		<field column=\"count\" label=\"数量\" type=\"number\" aggregate=\"sum\"/>\n  </fields>\n  <select>\n      SELECT\n      DISTINCT\n				pts.id,\n	     case \n			 when pts.`status`=\'pending\' then \'待处理\'\n			 when pts.`status`=\'running\' then \'进行中\'\n			 when pts.`status`=\'succeed\' then \'已完成\'\n			 when pts.`status`=\'aborted\' then \'已取消\'\n			 when pts.`status`=\'failed\' then \'已失败\'\n			 when pts.`status`=\'back\' then \'已回退\'\n			 when pts.`status`=\'hang\' then \'已挂起\'\n			 end as stepStatusName,\n       pts.`status` as stepStatus,\n	     ptsu.user_uuid as stepUserUuid,\n	     ptsuser.user_name as stepUserName,\n	     \'1\' as count\n		FROM\n			processtask pt\n			LEFT JOIN processtask_step pts ON pt.id = pts.processtask_id\n			LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n			AND pts.id = ptsu.processtask_step_id\n			LEFT JOIN `user` ptsuser ON ptsu.user_uuid = ptsuser.uuid \n		WHERE\n			DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n			AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n  </select>\n  <select>\n      SELECT\n      DISTINCT\n				pts.id,\n	     case \n			 when pts.`status`=\'pending\' then \'待处理\'\n			 when pts.`status`=\'running\' then \'进行中\'\n			 when pts.`status`=\'succeed\' then \'已完成\'\n			 when pts.`status`=\'aborted\' then \'已取消\'\n			 when pts.`status`=\'failed\' then \'已失败\'\n			 when pts.`status`=\'back\' then \'已回退\'\n			 when pts.`status`=\'hang\' then \'已挂起\'\n			 end as stepStatusName,\n       pts.`status` as stepStatus,\n	     ut.user_uuid as stepUserUuid,\n	     ptwuser.user_name as stepUserName,\n	     \'1\' as count\n		FROM\n			processtask pt\n			JOIN processtask_step pts ON pt.id = pts.processtask_id\n			JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'team\'\n			LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n			JOIN user_team ut on ptsw.uuid = ut.team_uuid\n			LEFT JOIN `user` ptwuser ON ut.user_uuid = ptwuser.uuid \n		WHERE\n			DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n			AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n			and ptsu.user_uuid != ptwuser.uuid \n  </select>\n  <select>\n      SELECT\n      DISTINCT\n				pts.id,\n	     case \n			 when pts.`status`=\'pending\' then \'待处理\'\n			 when pts.`status`=\'running\' then \'进行中\'\n			 when pts.`status`=\'succeed\' then \'已完成\'\n			 when pts.`status`=\'aborted\' then \'已取消\'\n			 when pts.`status`=\'failed\' then \'已失败\'\n			 when pts.`status`=\'back\' then \'已回退\'\n			 when pts.`status`=\'hang\' then \'已挂起\'\n			 end as stepStatusName,\n       pts.`status` as stepStatus,\n	     ur.user_uuid as stepUserUuid,\n	     ptwuser.user_name as stepUserName,\n	     \'1\' as count\n		FROM\n			processtask pt\n			JOIN processtask_step pts ON pt.id = pts.processtask_id\n			JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'role\'\n			LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n			JOIN user_role ur on ptsw.uuid = ur.role_uuid\n			LEFT JOIN `user` ptwuser ON ur.user_uuid = ptwuser.uuid \n		WHERE\n			DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n			AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n			and ptsu.user_uuid != ptwuser.uuid\n  </select>\n\n</datasource>',1,'0 5 0 * * ? *','replace',1,NULL,'done',4,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (676691047366656,'processTaskStepUser','工单步骤用户任务量',NULL,'<datasource name=\"processTaskStepUserDaySum\" label=\"工单步骤用户每天任务量统计\">\n  <fields>\n    <id column=\"stepName\" label=\"步骤名\" type=\"text\"/>\n		<id column=\"stepUserUuid\" label=\"处理人\" type=\"text\"/>\n		<field column=\"stepUserName\" label=\"处理人名\" type=\"text\"/>\n		<field column=\"count\" label=\"数量\" type=\"number\" aggregate=\"sum\"/>\n  </fields>\n  <select>\n    SELECT\n  pts.`name` as stepName,  \n  ptsu.user_uuid as stepUserUuid,\n  ptsuser.user_name as stepUserName,\n  \"1\" as `count` \nFROM\n  processtask pt\n  JOIN processtask_step pts ON pt.id = pts.processtask_id\n  JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n  AND pts.id = ptsu.processtask_step_id\n  LEFT JOIN `user` ptsuser ON ptsu.user_uuid = ptsuser.uuid\nWHERE\n   DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n      AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n  </select>\n    <select>\n   SELECT\n  pts.`name` as stepName,  \n  ptwuser.uuid as stepUserUuid,\n  ptwuser.user_name as stepUserName,\n  \"1\" as `count` \nFROM\n  processtask pt\n  JOIN processtask_step pts ON pt.id = pts.processtask_id\n  JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'team\'\n  LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n  JOIN user_team ut on ptsw.uuid = ut.team_uuid\n  LEFT JOIN `user` ptwuser ON ut.user_uuid = ptwuser.uuid \nWHERE\n      DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n      AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n      and ptsu.user_uuid != ptwuser.uuid \n  </select>\n   <select>\n   SELECT\n  pts.`name` as stepName,  \n  ptwuser.uuid as stepUserUuid,\n  ptwuser.user_name as stepUserName,\n  \"1\" as `count` \nFROM\n  processtask pt\n  JOIN processtask_step pts ON pt.id = pts.processtask_id\n  JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'role\'\n  LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n      JOIN user_role ur on ptsw.uuid = ur.role_uuid\n      LEFT JOIN `user` ptwuser ON ur.user_uuid = ptwuser.uuid \nWHERE\n      DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n      AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n      and ptsu.user_uuid != ptwuser.uuid\n  </select>\n\n</datasource>',1,'0 15 0 * * ? *','replace',1,NULL,'done',9,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (676691508740096,'processTaskStepUserAvgResponseCostTime','工单步骤用户平均响应耗时统计',NULL,'<datasource name=\"processTaskStepUserAvgResponseCostTime\" label=\"工单步骤用户平均响应耗时统计\">\n  <fields>\n    <id column=\"stepNameChannel\" label=\"步骤服务名\" type=\"text\"/>\n    <field column=\"stepName\" label=\"步骤名\" type=\"text\"/>\n		<id column=\"stepUserUuid\" label=\"处理人\" type=\"text\"/>\n		<field column=\"stepUserName\" label=\"处理人名\" type=\"text\"/>\n    <field column=\"channelUuid\" label=\"步骤名\" type=\"text\"/>\n    <field column=\"channelName\" label=\"步骤名\" type=\"text\"/>\n		<field column=\"timeCost\" label=\"平均耗时\" type=\"number\"/>\n    <field column=\"punctuality\" label=\"准时率\" type=\"number\"/>\n  </fields>\n  <select>\n    SELECT\n  concat( pts.NAME,\"(\", c.NAME,\")\" ) AS stepNameChannel,\n  pts.NAME AS stepName,\n  ptsu.user_uuid as stepUserUuid,\n  ptsuser.user_name as stepUserName,\n  c.uuid AS channelUuid,\n  c.NAME AS channelName,\n    AVG( ptsst.time_cost ) DIV 60000 AS timeCost ,\n  ROUND(\n    (\n    1 - SUM( ptsst.is_timeout ) / COUNT( 1 )) * 100,\n    2 \n  ) AS punctuality  \nFROM\n  processtask pt\n   JOIN processtask_step pts ON pt.id = pts.processtask_id\n   JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n  AND pts.id = ptsu.processtask_step_id\n  LEFT JOIN `user` ptsuser ON ptsu.user_uuid = ptsuser.uuid\n  LEFT JOIN channel c ON pt.channel_uuid = c.uuid\n  LEFT JOIN processtask_step_sla_time ptsst ON pts.id = ptsst.processtask_step_id \nWHERE\n  DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n  and pt.STATUS != \'draft\' and pt.is_deleted = 0\n  AND ptsst.`type` = \'response\' \n  AND pts.STATUS = \'succeed\' \nGROUP BY\n  stepNameChannel,\n  stepName,\n  stepUserUuid,\n  channelUuid \n  </select>\n</datasource>',1,'0 30 0 * * ? *','replace',1,NULL,'done',0,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (676691844284418,'processTaskStepUserStatusCount','工单步骤用户任务总数统计',NULL,'<datasource name=\"processTaskStepUserStatusCount\" label=\"工单步骤状态用户总数统计\">\n  <fields>\n		<id column=\"stepUserUuid\" label=\"处理人\" type=\"text\"/>\n		<field column=\"stepUserName\" label=\"处理人名\" type=\"text\"/>\n		<field column=\"count\" label=\"数量\" type=\"number\" aggregate=\"sum\"/>\n		<field column=\"all\" label=\"总数\" type=\"text\"/>\n  </fields>\n  <select>\n      SELECT\n      DISTINCT\n				pts.id,\n	     ptsu.user_uuid as stepUserUuid,\n	     ptsuser.user_name as stepUserName,\n	     \'1\' as count,\n	     \'总数\' as `all`\n		FROM\n			processtask pt\n			LEFT JOIN processtask_step pts ON pt.id = pts.processtask_id\n			LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n			AND pts.id = ptsu.processtask_step_id\n			LEFT JOIN `user` ptsuser ON ptsu.user_uuid = ptsuser.uuid \n		WHERE\n			DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n			AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n  </select>\n  <select>\n      SELECT\n      DISTINCT\n				pts.id,\n	     ut.user_uuid as stepUserUuid,\n	     ptwuser.user_name as stepUserName,\n	     \'1\' as count,\n	     \'总数\' as `all`\n		FROM\n			processtask pt\n			JOIN processtask_step pts ON pt.id = pts.processtask_id\n			JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'team\'\n			LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n			JOIN user_team ut on ptsw.uuid = ut.team_uuid\n			LEFT JOIN `user` ptwuser ON ut.user_uuid = ptwuser.uuid \n		WHERE\n			DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n			AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n			and ptsu.user_uuid != ptwuser.uuid \n  </select>\n  <select>\n      SELECT\n      DISTINCT\n				pts.id,\n	     ur.user_uuid as stepUserUuid,\n	     ptwuser.user_name as stepUserName,\n	     \'1\' as count,\n	     \'总数\' as `all`\n		FROM\n			processtask pt\n			JOIN processtask_step pts ON pt.id = pts.processtask_id\n			JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'role\'\n			LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n			JOIN user_role ur on ptsw.uuid = ur.role_uuid\n			LEFT JOIN `user` ptwuser ON ur.user_uuid = ptwuser.uuid \n		WHERE\n			DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n			AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n			and ptsu.user_uuid != ptwuser.uuid\n  </select>\n\n</datasource>',1,'0 20 0 ? * * *','replace',1,NULL,'done',2,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (676692204986368,'processTaskStepUserAvgCostTime','工单步骤用户平均处理耗时统计',NULL,'<datasource name=\"processTaskStepUserAvgCostTime\" label=\"工单步骤用户平均耗时统计\">\n  <fields>\n    <id column=\"stepNameChannel\" label=\"步骤服务名\" type=\"text\"/>\n    <field column=\"stepName\" label=\"步骤名\" type=\"text\"/>\n		<id column=\"stepUserUuid\" label=\"处理人\" type=\"text\"/>\n		<field column=\"stepUserName\" label=\"处理人名\" type=\"text\"/>\n    <field column=\"channelUuid\" label=\"步骤名\" type=\"text\"/>\n    <field column=\"channelName\" label=\"步骤名\" type=\"text\"/>\n    <field column=\"timeCost\" label=\"平均耗时\" type=\"number\"/>\n    <field column=\"punctuality\" label=\"准时率\" type=\"number\"/>\n  </fields>\n  <select>\n    SELECT\n  concat( pts.NAME,\"(\", c.NAME,\")\" ) AS stepNameChannel,\n  pts.NAME AS stepName,\n  ptsu.user_uuid as stepUserUuid,\n  ptsuser.user_name as stepUserName,\n  c.uuid AS channelUuid,\n  c.NAME AS channelName,\n    AVG( ptsst.time_cost ) DIV 60000 AS timeCost ,\n  ROUND(\n    (\n    1 - SUM( ptsst.is_timeout ) / COUNT( 1 )) * 100,\n    2 \n  ) AS punctuality  \nFROM\n  processtask pt\n   JOIN processtask_step pts ON pt.id = pts.processtask_id\n   JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n  AND pts.id = ptsu.processtask_step_id\n  LEFT JOIN `user` ptsuser ON ptsu.user_uuid = ptsuser.uuid\n  LEFT JOIN channel c ON pt.channel_uuid = c.uuid\n  LEFT JOIN processtask_step_sla_time ptsst ON pts.id = ptsst.processtask_step_id \nWHERE\n  DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n  and pt.STATUS != \'draft\' and pt.is_deleted = 0\n  AND ptsst.`type` = \'handle\' \n  AND pts.STATUS = \'succeed\' \nGROUP BY\n  stepNameChannel,\n  stepName,\n  stepUserUuid,\n  channelUuid \n  </select>\n</datasource>',1,'0 25 0 * * ? *','