insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (740997118042112,'processTaskStepUserDaySum','工单步骤用户每天任务量统计',NULL,'<datasource name=\"processTaskStepUserDaySum\" label=\"工单步骤用户每天任务量统计\">\n  <fields>\n    <id column=\"stepEveryday\" label=\"日期\" type=\"date\"/>\n		<id column=\"stepUserUuid\" label=\"处理人\" type=\"text\"/>\n		<field column=\"stepUserName\" label=\"处理人名\" type=\"text\"/>\n		<field column=\"count\" label=\"数量\" type=\"number\" aggregate=\"sum\"/>\n  </fields>\n  <select>\n  	SELECT\n		a.stepEveryday,\n		a.userUuid as stepUserUuid,\n		a.userName as stepUserName,\n		SUM( b.COUNT ) AS `count` \n	FROM\n		(\n		SELECT\n			STR_TO_DATE( pts.active_time, \'%Y-%m-%e\' ) AS stepEveryday,\n			ptsuser.uuid as userUuid,\n			ptsuser.user_name as userName,\n			count( DISTINCT pts.id ) `count` \n		FROM\n			processtask pt\n			LEFT JOIN processtask_step pts ON pt.id = pts.processtask_id\n			JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n			AND pts.id = ptsu.processtask_step_id\n			LEFT JOIN `user` ptsuser ON ptsu.user_uuid = ptsuser.uuid \n		WHERE\n			DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n			AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n		GROUP BY\n			stepEveryday,ptsu.user_uuid\n		ORDER BY\n			stepEveryday ASC \n		) a\n		JOIN (\n		SELECT\n			STR_TO_DATE( pts.active_time, \'%Y-%m-%e\' ) AS stepEveryday,\n			ptsuser.uuid as userUuid,\n			ptsuser.user_name as userName,\n			count( DISTINCT pts.id ) `count` \n		FROM\n			processtask pt\n			LEFT JOIN processtask_step pts ON pt.id = pts.processtask_id\n			JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n			AND pts.id = ptsu.processtask_step_id\n			LEFT JOIN `user` ptsuser ON ptsu.user_uuid = ptsuser.uuid \n		WHERE\n			DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n			AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n		GROUP BY\n			stepEveryday ,ptsu.user_uuid\n		ORDER BY\n			stepEveryday ASC \n		) b ON a.stepEveryday >= b.stepEveryday and a.userUuid = b.userUuid\n	GROUP BY\n		a.stepEveryday ,a.userUuid\n	ORDER BY\n	stepEveryday ASC\n  </select>\n\n  <select>\n  	SELECT\n	a.stepEveryday,\n	a.userUuid as stepUserUuid,\n	a.userName as stepUserName,\n	SUM( b.COUNT ) AS `count` \nFROM\n	(\n	SELECT\n		STR_TO_DATE( pts.active_time, \'%Y-%m-%e\' ) AS stepEveryday,\n		ptwuser.uuid as userUuid,\n		ptwuser.user_name as userName,\n		count( DISTINCT pts.id ) `count` \n	FROM\n		processtask pt\n		LEFT JOIN processtask_step pts ON pt.id = pts.processtask_id\n		JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'team\'\n		LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n		JOIN user_team ut on ptsw.uuid = ut.team_uuid\n		LEFT JOIN `user` ptwuser ON ut.user_uuid = ptwuser.uuid \n	WHERE\n		DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n		AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n		and ptsu.user_uuid != ptwuser.uuid\n	GROUP BY\n		stepEveryday,ptwuser.uuid\n	ORDER BY\n		stepEveryday ASC \n	) a\n	JOIN (\n		SELECT\n		STR_TO_DATE( pts.active_time, \'%Y-%m-%e\' ) AS stepEveryday,\n		ptwuser.uuid as userUuid,\n		ptwuser.user_name as userName,\n		count( DISTINCT pts.id ) `count` \n	FROM\n		processtask pt\n		LEFT JOIN processtask_step pts ON pt.id = pts.processtask_id\n		JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'team\'\n		LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n		JOIN user_team ut on ptsw.uuid = ut.team_uuid\n		LEFT JOIN `user` ptwuser ON ut.user_uuid = ptwuser.uuid \n	WHERE\n		DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n		AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n		and ptsu.user_uuid != ptwuser.uuid\n	GROUP BY\n		stepEveryday,ptwuser.uuid\n	ORDER BY\n		stepEveryday ASC \n	) b ON a.stepEveryday >= b.stepEveryday and a.userUuid = b.userUuid\nGROUP BY\n	a.stepEveryday ,a.userUuid\nORDER BY\n	stepEveryday ASC\n  </select>\n  <select>\n  	SELECT\n	a.stepEveryday,\n	a.userUuid as stepUserUuid,\n	a.userName as stepUserName,\n	SUM( b.COUNT ) AS `count` \nFROM\n	(\n	SELECT\n		STR_TO_DATE( pts.active_time, \'%Y-%m-%e\' ) AS stepEveryday,\n		ur.user_uuid as userUuid,\n		ptwuser.user_name as userName,\n		count( DISTINCT pts.id ) `count` \n	FROM\n		processtask pt\n		LEFT JOIN processtask_step pts ON pt.id = pts.processtask_id\n		JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'role\'\n		LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n		JOIN user_role ur on ptsw.uuid = ur.role_uuid\n		LEFT JOIN `user` ptwuser ON ur.user_uuid = ptwuser.uuid \n	WHERE\n		DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n		AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n		and ptsu.user_uuid != ptwuser.uuid\n	GROUP BY\n		stepEveryday,ur.user_uuid\n	ORDER BY\n		stepEveryday ASC \n	) a\n	JOIN (\n		SELECT\n		STR_TO_DATE( pts.active_time, \'%Y-%m-%e\' ) AS stepEveryday,\n		ur.user_uuid as userUuid,\n		ptwuser.user_name as userName,\n		count( DISTINCT pts.id ) `count` \n	FROM\n		processtask pt\n		LEFT JOIN processtask_step pts ON pt.id = pts.processtask_id\n		JOIN processtask_step_worker ptsw ON pts.processtask_id = ptsw.processtask_id AND pts.id = ptsw.processtask_step_id and ptsw.type = \'role\'\n		LEFT JOIN processtask_step_user ptsu ON pts.processtask_id = ptsu.processtask_id \n		JOIN user_role ur on ptsw.uuid = ur.role_uuid\n		LEFT JOIN `user` ptwuser ON ur.user_uuid = ptwuser.uuid \n	WHERE\n		DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(pts.active_time)\n		AND pt.STATUS != \'draft\' and pt.is_deleted = 0\n		and ptsu.user_uuid != ptwuser.uuid\n	GROUP BY\n		stepEveryday,ur.user_uuid\n	ORDER BY\n		stepEveryday ASC \n	) b ON a.stepEveryday >= b.stepEveryday and a.userUuid = b.userUuid\nGROUP BY\n	a.stepEveryday ,a.userUuid\nORDER BY\n	stepEveryday ASC\n  </select>\n    </datasource>',1,'0 35 0 * * ? *','replace',1,NULL,'done',1,'day','mysql');
