insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (785413245509649,'inspectAlert','当天巡检高级等级统计',NULL,'<datasource name=\"inspectAlert\" label=\"当天告警等级统计\">\n  <fields>\n    <id column=\"alertLevel\" label=\"告警等级\" type=\"text\"/>\n	<field column=\"count\" label=\"数量\" type=\"number\"/>\n  </fields>\n  <select>\n    select \n     case \n        when iae.`alert_level`=\'CRITICAL\' then \'严重\'\n        when iae.`alert_level`=\'WARN\' then \'告警\'\n        when iae.`alert_level`=\'FATAL\' then \'致命\'\n        end as alertLevel,\n        count(1) as `count`\n    from inspect_alert_everyday iae \n    where \n    iae.report_time = DATE_SUB(CURDATE(), INTERVAL 1 DAY)\n    GROUP BY iae.alert_level\n  </select>\n</datasource>',1,'0 5,30 3,8,9 * * ? *','replace',30,NULL,'done',0,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (785413245509652,'inspectAlertEveryDay','近一周巡检告警数量',NULL,'<datasource name=\"inspectAlertEveryDay\" label=\"当天告警等级统计\">\n  <fields>\n    <id column=\"reportTime\" label=\"巡检时间\" type=\"text\"/>\n	<field column=\"count\" label=\"数量\" type=\"number\"/>\n  </fields>\n  <select>\n    select \n			 count(1) as `count`,\n			 iae.report_time as reportTime\nfrom inspect_alert_everyday iae where \n iae.report_time &gt;= DATE_SUB(CURDATE(), INTERVAL 7 DAY)\nGROUP BY iae.report_time\n\n  </select>\n</datasource>',1,'0 30 3,8 * * ? *','replace',30,NULL,'done',0,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (872276551540736,'processTaskDaySum','近30天每天工单总数',NULL,'<datasource name=\"processTaskStepUserDaySum\" label=\"工单步骤用户每天任务量统计\">\n  <fields>\n    <id column=\"startTime\" label=\"日期\" type=\"date\"/>\n	<field column=\"count\" label=\"数量\" type=\"number\" aggregate=\"sum\"/>\n  </fields>\n  <param column=\"id\" type=\"max\" label=\"最大id\" default=\"0\"/>\n  <select>\n    SELECT\n        STR_TO_DATE( start_time, \'%Y-%m-%e\' ) AS startTime,\n        1 AS count,\n        id \n    FROM processtask \n    where DATE_SUB(CURDATE(), INTERVAL 30 DAY) &lt;= date(start_time)\n    and is_deleted = 0\n    ORDER BY id ASC\n  </select>\n</datasource>',1,'0 0 1 ? * * *','replace',30,NULL,'done',1,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (872341319983104,'processTaskSum','工单总数',NULL,'<datasource name=\"processTaskStepUserDaySum\" label=\"工单步骤用户每天任务量统计\">\n  <fields>\n    <field column=\"label\" label=\"工单总数\" type=\"text\" />\n	<field column=\"count\" label=\"数量\" type=\"number\" />\n  </fields>\n  <select>\n    SELECT\n    	\"工单总数\" as label,\n    	count(1) as count\n    FROM processtask where is_deleted = 0\n  </select>\n</datasource>',1,'0 0 0 ? * * *','replace',30,NULL,'done',1,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (872370814328832,'processTaskStatusCount','工单状态总数',NULL,'<datasource name=\"processTaskStepUserDaySum\" label=\"工单步骤用户每天任务量统计\">\n  <fields>\n    <field column=\"status\" label=\"工单状态\" type=\"text\" />\n	<field column=\"count\" label=\"数量\" type=\"number\" />\n  </fields>\n  <select>\n    SELECT\n    	case \n			 when `status`=\'pending\' then \'待处理\'\n			 when `status`=\'running\' then \'进行中\'\n			 when `status`=\'succeed\' then \'已完成\'\n			 when `status`=\'aborted\' then \'已取消\'\n			 when `status`=\'failed\' then \'已失败\'\n			 when `status`=\'back\' then \'已回退\'\n			 when `status`=\'hang\' then \'已挂起\'\n			 when `status`=\'scored\' then \'已评分\'\n			 end as `status`,\n       count(`status`) as count\n    FROM processtask where is_deleted = 0\n  group by  `status` \n  </select>\n</datasource>',1,'0 0 0 ? * * *','replace',30,NULL,'done',2,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (872409586475008,'processTaskScoreCount','工单评分统计',NULL,'<datasource name=\"processTaskStepUserDaySum\" label=\"工单步骤用户每天任务量统计\">\n  <fields>\n    <field column=\"score\" label=\"分数\" type=\"text\" />\n	<field column=\"count\" label=\"数量\" type=\"number\" />\n  </fields>\n  <select>\n    select score,count(score)  as count from processtask_score GROUP BY score order by score asc\n  </select>\n</datasource>',1,'0 0 3 ? * * *','replace',30,NULL,'done',1,'day','mysql');
insert  into `datawarehouse_datasource`(`id`,`name`,`label`,`description`,`xml`,`is_active`,`cron_expression`,`mode`,`expire_count`,`module_id`,`status`,`data_count`,`expire_unit`,`db_type`) values (872416389636096,'processTaskChannelTypeCount','工单服务类型统计',NULL,'<datasource name=\"processTaskStepUserDaySum\" label=\"工单步骤用户每天任务量统计\">\n  <fields>\n    <field column=\"name\" label=\"服务类型\" type=\"text\" />\n	<field column=\"count\" label=\"数量\" type=\"number\" />\n  </fields>\n  <select>\n    select \n     d.`name`,\n     count(d.name) as count\n     from processtask p \n     left join channel c on p.channel_uuid = c.uuid\n     left JOIN channel_type d on c.channel_type_uuid = d.uuid\n     where is_deleted = 0\n     GROUP BY d.`name` \n  </select>\n</datasource>',1,'0 0 16 ? * * *','replace',30,NULL,'done',4,'day','mysql');
